class Solution:
    def findAnagrams(self, s: str, p: str):
        out = []
        for i in range(0,(len(s) - len(p))+1):
            count = 0
            temp = s[i:i+len(p)]
            for character in p:
                if character in temp:
                    temp = temp.replace(character,'',1)
                    count+=1
            if count == len(p):
                out.append(i)
        return out


